// components/DeleteCar.js
import React from "react";
import './GetAllCars.css';

export default function DeleteCar(props) {
  const handleCarId = async () => {
    const url = `http://localhost:5000/cars/${props.carId}`;

    try {
      const request = await fetch(url, {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      if (!request.ok) {
        console.error(`Hiba a törlés során (${request.status}): ${request.statusText}`);
        return;
      }

      console.log("Autó sikeresen törölve.");
      props.onDeleteComplete(); // Notify parent component
    } catch (error) {
      console.error('Hiba történt a törlés kérésekor:', error);
    }
  };

  return (
    <button className="delete-button" onClick={handleCarId}>
      Töröl
    </button>
  );
}
